<tr>
<td>shift()</td>
<td>\u5220\u9664\u5E76\u8FD4\u56DE\u6570\u7EC4\u7684\u7B2C\u4E00\u4E2A\u5143\u7D20\u3002</td>
</tr>
<tr>
