<p><strong>instanceof\u8FD0\u7B97\u7B26</strong></p>
<blockquote>
<p>instanceof\u8FD0\u7B97\u7B26\u7528\u4E8E\u5224\u65AD\u5BF9\u8C61\u662F\u5426\u662F\u6307\u5B9A\u7684\u7C7B\u578B\uFF0C\u5982\u679C\u662F\u8FD4\u56DEtrue\uFF0C\u5426\u5219\u8FD4\u56DEfalse\u3002</p>
